INSERT INTO `Recipe` (`rid`, `uid`, `rtitle`, `rserving`, `rdescription`) VALUES
('584c544626e2d', 7, 'Kung Pao Chicken', 4, 'Spicy chicken with peanuts, similar to what is served in Chinese restaurants. It is easy to make, and you can be as sloppy with the measurements as you want. They reduce to a nice, thick sauce. Substitute cashews for peanuts, or bamboo shoots for the water chestnuts. You can''t go wrong! Enjoy!'),
('584dfbba75601', 7, 'Asian Orange Chicken', 4, 'A delicious citrus chicken recipe with flavors reminiscent of the orange chicken from a popular restaurant in the mall.'),
('584e015131bff', 7, 'Sesame Pasta Chicken Salad', 10, 'A refreshing light pasta salad with a delicious Asian flair. Great for a summer cookout or picnic. Tastes great right away, and even better if you can allow it to marinate for a while.'),
('584e04536f384', 7, 'Chinese Pepper Steak', 4, 'A delicious meal, served with boiled white rice, that''s easy and made from items that I''ve already got in my cupboards! My mother clipped this recipe from somewhere and it became a specialty of mine; however, I''ve been unable to find the original source.'),
('584e0544b0900', 7, 'Miso Soup', 4, 'Dashi is a basic stock used in Japanese cooking which is made by boiling dried kelp (seaweed) and dried bonito (fish). Instant dashi granules are sold in conveniently-sized jars or packets and vary in strength. Add more dashi to your soup if you want a stronger stock. You can use yellow, white or red miso paste for this soup. Yellow miso is sweet and creamy, red miso is stronger and saltier.'),
('584e060717bea', 7, 'Spicy Orange Beef', 4, 'This stir-fry is a good weekday dinner recipe. It can be made in about the time it takes to make a pot of rice to serve with it.');

