('584c6bfaa097f', '584c544626e2d', 7, 5, 'It''s not unusual for me to eat Chinese out two or three times per week, so I have a LOT of experience in eating Chinese food. I''ve been to 90% of the Chinese restaurants in the metro area I live in. And hey--this stuff passes the test. It''s the first time I''ve tried cooking Chinese and I can''t believe how easy it was. ', 'Great Experience'),
('584e025140901', '584dfbba75601', 7, 5, 'This is my favorite recipe that I have found at allrecipes.com - I fell in love with it when I was making (and tasting) the sauce! The sauce is AMAZING and so delicious, really to die for, and it *makes* the dish. ', 'My favorite!'),
('584e02eb5ca55', '584e015131bff', 7, 5, 'I''ve received many compliments on this recipe, having served it a few times. I would only alter a few things: add julienned carrots, sliced water chestnuts and pea pods cut in half on an angle- really adds nice color, texture and flavor.', 'I love this recipe.');

